import Vue from 'vue'
Vue.component("YuhuaHome", () => import("/Users/chenyu/Documents/GitHub/yuhuatrade/docs/.vuepress/components/YuhuaHome.vue"))
import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-d6842cdf2d303",
    path: "/Product/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/chenyu/Documents/GitHub/yuhuatrade/docs/Product/README.md").then(comp => {
        Vue.component("v-d6842cdf2d303", comp.default)
        next()
      })
    }
  },
  {
    path: "/Product/index.html",
    redirect: "/Product/"
  },
  {
    name: "v-7e055fef1ee63",
    path: "/Product/one.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/chenyu/Documents/GitHub/yuhuatrade/docs/Product/one.md").then(comp => {
        Vue.component("v-7e055fef1ee63", comp.default)
        next()
      })
    }
  },
  {
    name: "v-2462f8e6bb352",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/chenyu/Documents/GitHub/yuhuatrade/docs/README.md").then(comp => {
        Vue.component("v-2462f8e6bb352", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
